import axios from "axios";

export const GET_PROFILE = "GET_PROFILE";

export const getProfile = () => {
  return (dispatch) => {
    return axios
      .post("http://localhost:3001/api/v1/user/profile", {
        headers: {
          Authorization: "Bearer",
        },
      })
      .then((res) => {
        console.log(res);
      });
  };
};
